constructor(props){
  super(props)
  this.state={entry: ''}
  this.onInputChange=this.onInputChange.bind(this);
} 

  onInputChange(event){
       this.setState({entry:event.target.value})
       console.log(this.state.entry)
  }

  render(){

return(
  <div>
    <form>
      <input type="text" value={this.state.entry} placeholder='Time' onChange={this.onInputChange}></input>
    </form>
    console.log()
  </div>
)

}



}

